import React from "react";
import { Form, Formik } from 'formik';
import Textfield from '../common/Textfield'
import "./account.scss";

export default function Account() {
    return (
        <div className='account'>
            <div className="container">
                <div className="mainTitle">
                    Create account
                </div>
                <div className="firstnameInput">A</div><div className>B</div>
                <div className="labelText">Username</div>
                <input type="text" placeholder="Enter Username" required />

                <button type="submit">Next</button>
            </div>
            <div className="centerText commonLabels">
                    New to Autodesk ? <a href={''} >Create account</a>
                </div>

                <div className="footer commonLabels">
                    <p>Your account for everything Autodesk</p>
                    <a href={''} >Learn More</a>
                </div>
        </div>
    );
}
